pub fn generates_words() -> (Vec<String>, Vec<String>) {
    let adjectives: Vec<String> = get_adjectives()
        .split("#")
        .map(|w| w.trim().to_string())
        .collect();

    let nouns: Vec<String> = get_nouns()
        .split("#")
        .map(|w| w.trim().to_string())
        .collect();

    (adjectives, nouns)
}

